import React from 'react';
import './App.css';
import CreateReservation from './components/CreateReservation';
import ReservationList from './components/ReservationList';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>LIC Reservation System</h1>
        <CreateReservation />
        <ReservationList />
      </header>
    </div>
  );
}

export default App;
